import React from "react";

function SongList ({songs}) {
  const test = [
    {song: 'gogo', id:1},
    {song: 'gogo', id:2},
    {song: 'gogo', id:3},
    {song: 'gogo', id:4},
  ]

  return (
    <div className="main">
      <div className="songList">
        <h2>Results</h2>
        <ul>
          {songs.map(song => (
            <li key={song.id}>{song.name}</li>
          ))}
        </ul>
      </div>

      <div className="songList">
        <h2>Playlist</h2>
        <ul>
          {test.map(item => (
            <li key={item.id}>{item.song}</li>
          ))}
        </ul>
      </div>
    </div>
  )
}

export default SongList;
